  //   rating,
  //   description
  // } = product
  return (
    <div className="product-dets-info">
      <h3 className="product-dets-info__name">{product.title}</h3>
      <p className="product-dets-info__price">{price}</p>
      <p className="product-dets-info__rating">{rating}</p>
      <p className="product-dets-info__color">{color}</p>
      <p className="product-dets-info__size">{size}</p>
      <div className="product-dets-info-desc">
        <h4 className="product-dets-info-desc__heading">
          Description
        </h4>
        <p className="product-dets-info-desc__description">
          {description}
        </p>
      </div>
    </div>
  )
}
